import React, { Component } from "react";
class Form extends Component {
    constructor(){
        super()
        this.state={
            username:""
        }
    }
    usernameChange =(event)=>{
        this.setState({
            username:event.target.value
        })
    }
    render(){
        return (
            <div>
                <label>Username:</label>
                <input type="text" />
            </div>
        )
    }
}
export default Form;
